import { Component } from '@angular/core';
import { Router } from '@angular/router';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent {
  title = 'DEMO_EXAMENFINAL';

  constructor(private router:Router){

  }
  Listar(){
    this.router.navigate(["listar"]);
  }
  Nuevo(){
    this.router.navigate(["add"]);
  }
}

<div class="container-fluid p-5 bg-black text-white text-center">
  <h1>EXAMEN FINAL</h1>
  <p>Lesly Sasshira Cruz Pancca</p> 
</div>
<div class="container mt-5">
  <div class="row">
   <div class="d-flex justify-content-center align-items-center vh-100">
      <button (click)="listar()"  type="button" class="btn btn-primary">LISTAR USUARIO</button>
      <button (click)="Nuevo()"  type="button" class="btn btn-success" style="margin-left: 10px;">NUEVO USUARIO</button>
   </div>
  </div>
</div>

<router-outlet></router-outlet>
